concat( 
  "M", 
  if( 
    row_id() < 10, 
    concat("0000", row_id()), 
    if( 
      row_id() < 100, 
      concat("000", row_id()), 
      if( 
        row_id() < 1000, 
        concat("00", row_id()), 
        if( 
          row_id() < 10000, 
          concat("0", row_id()), 
          row_id() 
        ) 
      ) 
    ) 
  ) 
)

when_nan( 
  multiply( 
    divide( 
      field("Total budget"), 
      field("Impressions") 
    ), 
    1000 
  ), 
  0 
)

if( 
  or( 
    isblank(field("Impressions")), 
    field("Impressions") = 0
  ), 
  "", 
  concat( 
    round( 
      multiply( 
        divide( 
          multiply( 
            field("Conversions"), 
            100 
          ), 
          field("Impressions") 
        ), 
        100 
      ), 
      4 
    ), 
    "%" 
  )  
